import { Container, LogoContainer, ButtonContainer, ButtonIcon } from "./style";
import HamburgerIcon from "../../assets/hamburger.png";

function Header() {
  return (
    <Container>
      <LogoContainer>
        <ButtonContainer>
          <ButtonIcon alt="" src={HamburgerIcon} />
        </ButtonContainer>
      </LogoContainer>
    </Container>
  )
}

export default Header;
